"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[899],{95378:e=>{e.exports=JSON.parse('{"tag":{"label":"baseline","permalink":"/teamforge/docs/tags/baseline","allTagsPath":"/teamforge/docs/tags","count":16,"items":[{"id":"BaselinePages/baseline-settings","title":"Baseline Settings","description":"As a baseline administrator, you can configure the custom attributes used in the baselines, configure the custom statuses, and manage workflow status transitions and field inclusions.","permalink":"/teamforge/docs/BaselinePages/baseline-settings"},{"id":"BaselinePages/compare-baselines","title":"Compare Baselines and Baseline Definitions","description":"You can compare two Baselines created at two different points in time to know the differences. You can also compare the Baseline Definitions of two Baselines.","permalink":"/teamforge/docs/BaselinePages/compare-baselines"},{"id":"BaselinePages/create-baseline","title":"Create and View Baselines","description":"Create a Baseline when you accomplish specific milestones in your project or when you release or deliver a product. You can create a Baseline from either a Baseline Definition or from the ground up.","permalink":"/teamforge/docs/BaselinePages/create-baseline"},{"id":"BaselinePages/create-project-baseline","title":"Create and View Project Baselines","description":"A Project Baseline is a baseline created on a project at a given point in time. Once you have Project Baselines created, you can kick start new projects from Project Baselines and proceed from when and where the Project Baselines were created in the past. Project Baselines are typically created using Project Baseline Definitions, when you release or deliver a product. You can create as many Project Baselines as required.","permalink":"/teamforge/docs/BaselinePages/create-project-baseline"},{"id":"BaselinePages/create-baseline-def","title":"Create, View, and Delete Baseline Definitions","description":"A Baseline Definition is the filter criteria that is used to create a Baseline from a set of selected configuration items such as Tracker Artifacts, Documents, Source Code Repositories (only Git and Subversion are supported), File Releases, and Binaries (only Nexus binaries are supported) in a given TeamForge project.","permalink":"/teamforge/docs/BaselinePages/create-baseline-def"},{"id":"BaselinePages/delete-baselines","title":"Delete Baselines","description":"You can delete Open and Rejected (meta status) baselines as long as you have the DELETE/VIEW BASELINE permission assigned to you. You cannot delete approved baselines.","permalink":"/teamforge/docs/BaselinePages/delete-baselines"},{"id":"BaselinePages/edit-baseline-def","title":"Edit Baseline Definitions","description":"You can edit an existing Baseline Definition to add more filter criteria or modify the existing fields and filter criteria.","permalink":"/teamforge/docs/BaselinePages/edit-baseline-def"},{"id":"BaselinePages/edit-baseline","title":"Edit Baselines","description":"You can edit the existing fields in a Baseline as long as the Baseline is in open status. A Baseline cannot be edited after it is approved or rejected.","permalink":"/teamforge/docs/BaselinePages/edit-baseline"},{"id":"BaselinePages/binary-repo-caching","title":"Enable Caching for Baselines","description":"You can enable caching for TeamForge Baselines in case you have a large number of binary (Nexus) repositories. Caching Nexus repositories enables fast loading of Nexus repositories when you try to create or modify the binary filter criteria for baselines or baseline definitions.","permalink":"/teamforge/docs/BaselinePages/binary-repo-caching"},{"id":"BaselinePages/generate-baseline-package","title":"Generate and Download Baseline Packages","description":"You can generate a downloadable package of physical project artifacts such as Tracker Artifacts, Documents, Source Code Repositories (only Git and Subversion are supported), File Releases, and Binaries (only Nexus binaries are supported) from an approved Baseline or a Project Baseline and share the package with your stakeholders.","permalink":"/teamforge/docs/BaselinePages/generate-baseline-package"},{"id":"BaselinePages/baseline-glossary","title":"Glossary of Baseline Terms","description":"Baseline","permalink":"/teamforge/docs/BaselinePages/baseline-glossary"},{"id":"installpages/requirements","title":"Installation Requirements","description":"Here\'s what it takes to install and run TeamForge and other integrations supported by TeamForge.","permalink":"/teamforge/docs/installpages/requirements"},{"id":"BaselinePages/project-baseline-definition","title":"Project Baseline Definition","description":"A Project Baseline Definition is the filter criteria that is used to create a baseline from a set of selected configuration items at the project level.","permalink":"/teamforge/docs/BaselinePages/project-baseline-definition"},{"id":"BaselinePages/baseline-review-approval-workflow","title":"Review Baselines","description":"A Baseline or a Project Baseline, once created can be reviewed. During the review cycle, the Baseline or the Project Baseline undergoes various status transitions as defined by the Baseline Administrator.","permalink":"/teamforge/docs/BaselinePages/baseline-review-approval-workflow"},{"id":"BaselinePages/search-baseline","title":"Search Baselines and Baseline Definitions","description":"You can search for the existing Baselines, Project Baselines and Baseline Definitions based on all stored attributes.","permalink":"/teamforge/docs/BaselinePages/search-baseline"},{"id":"BaselinePages/baseline-overview","title":"TeamForge Baseline - An Overview","description":"What is a Baseline Definition?","permalink":"/teamforge/docs/BaselinePages/baseline-overview"}],"unlisted":false}}')}}]);